    [],nt"num_tags": 6,nt"name": "upper-klamath-national-wildlife-refuge-annual-narrative-report-calendar-year-1981",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Upper
    Klamath National Wildlife Refuges outlines Refuge accomplishments during the 1981
    calendar year. The report begins with an introduction to the Refuge and information
    about weather conditions, habitat conditions, land acquisition activities, and the
    system status. Construction and maintenance are also described. Habitat management
    is covered; croplands, grasslands, and wetlands are discussed. The wildlife section
    of the report discusses endangered and threatened species, migratory birds, and
    mammals. Interpretation and recreation activities are outlined; topics include information
    and interpretation and law enforcement. Cooperative programs and safety information
    are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
